              <Percent size={14}/><span>Descuento</span>
            </Button>
            {canAccessEmployeeConsumption && (
              <Button onClick={() => setIsEmployeeConsumptionModalOpen(true)} variant="outline" className="font-medium flex items-center space-x-1 text-[#F0F0F0] border-[#3a3a4a] hover:bg-[#3a3a4a] text-sm flex-1">
                <UserCircle size={14}/><span>Consumo</span>
              </Button>
            )}
          </div>

          {/* Módulo Keypad */}
          <Keypad
            onNumberInput={handleNumberInput}
            onFunction={handleKeypadFunction}

